import mole from "../core/Mole";

const ModalReadyTest = () => {
    const testData = [
        {row: 2, column:2, count: 1},
        {row: 3, column:3, count: 3},
        {row: 4, column:3, count: 4},
        {row: 5, column:5, count: 8},
        {row: 6, column:6, count: 10}
    ]

    return (
        <>
        <label className="test-label">테스트 데이터</label>
        <p>데이터를 선택하시면 </p>
        <table className="rank-table clearfix" >
            <tbody>
                <tr>
                    {mole.list.screenDataList.map((item: {
                        value: string, 
                        label: string
                    }) => {
                        return <th>{item.label}</th>
                    })}
                </tr>
                {testData.map((item: {
                    row: number,
                    column: number,
                    count: number
                }) => {
                    return (
                        <tr key={item.row + '-' + item.column + '-' + item.count}
                            onClick={() => {
                            mole.setState('screenData', {
                                row: item.row,
                                column: item.column,
                                count: item.count
                            })
                        }}>
                            <td>{item.row}</td>
                            <td>{item.column}</td>
                            <td>{item.count}</td>
                        </tr>
                    )
                })}
            </tbody>
        </table>
        </>
    )
}

export default ModalReadyTest
